class Solution:
    def minimumOperations(self, nums: List[int], target: List[int]) -> int:
        change = [a - b for a,b in zip(nums, target)]
        level = 0
        res = 0
        for c in change:
            res += max(c-level,0)
            level = c
        res += max(0, -change[-1])
        return res
